import React from 'react';

export const Footer = () => (

    <div className="container">
      <div className="row mr-auto">
        <div className="col">
          <a className="nav-link text-dark" href="mailto:contact@quanvy.com">Contact Us</a>
        </div>
      </div>
      <div className="col-md text-lg-right">
        <small>Copyright &copy; 2020 Quanvy, Inc. All rights reserved.</small>
      </div>
    </div>
);
